import { Flex } from "@chakra-ui/react";
import Nav from "./nav";

const Layout = ({ children, categories, seo }) => (
  <Flex height="100vh" direction="column">
    <Nav categories={categories} />
    {children}
  </Flex>
);

export default Layout;
